                                        <p>Rahul has 24+ years of experience in the IT industry with a strong Product Development background in the Telecom and Finance domains. He has worked as an Agile &amp; DevOps Consultant with leading organizations in India, US and UK. He specializes in software-as-a-service product development and cloud computing. He is passionate about Lean-Agile practices and believes Agile/Lean and DevOps are enablers in achieving true Business Agility. &nbsp;</p>
