                                <div class="media-body">
                                    <h3>Pavan Kiran Ravula</h3> <span>Trainer</span>
                                </div>
                            </div>
                            <div style="height:96px;overflow:hidden;margin-bottom:11px;" class="editor-content">
                                <p>Kiran Ravula is a seasoned agile practitioner with extensive experience in the field of product development and program delivery,&nbsp;&nbsp;with Pragmatic balance between agile theory and in-the-trenches decision-making on practices.&nbsp;He is an ICAgile Certified Agile Coach, SPC 4 – SAFe Program Consultant, Certified LeSS Practitioner and ICAgile Authorized Agile Trainer.</p>
                                <p>He has been using agile values and principles for software development process since 2010, with excellent experience as scrum Master and Agile Coach. He has vast experience in facilitating agile training and&nbsp;workshops&nbsp;in multiple&nbsp;organization and helping teams embrace Agile, Lean principles and practices.</p>
