                            <div style="height:96px;overflow:hidden;margin-bottom:11px;" class="editor-content">
                                <p>Rahul has 24+ years of experience in the IT industry with a strong Product Development background in the Telecom and Finance domains. He has worked as an Agile &amp; DevOps Consultant with leading organizations in India, US and UK. He specializes in software-as-a-service product development and cloud computing. He is passionate about Lean-Agile practices and believes Agile/Lean and DevOps are enablers in achieving true Business Agility. &nbsp;</p>
                                <p>Over the past 6 years, Rahul has trained more than 3000+ professionals on various Agile Methodologies such as Scrum, SAFe and XP Practices, helping organizations in instilling Agile culture and DevOps engineering practices that are required for success. He works as a SAFe Program Consultant at KnowledgeHut and has been involved in SAFe Transformation of enterprises. &nbsp;</p>
