                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>With our 100% Satisfaction Guarantee policy, you are assured of the highest standards of quality. At KnowledgeHut, we strive to ensure that your learning experience with us is beyond reproach. However, if for any reason your expectations are not met, we will refund the course fee in accordance with our&nbsp;<a href="#" target="_blank" style="background-color:#fff;">100% Satisfaction Guarantee policy</a>.<br></p>
