                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-13" aria-expanded="false" aria-controls="faq-1-13">I’d like to know more about the training program. Whom should I contact?</a> </h4>
                                </div>
                                <div id="faq-1-13" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-13">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>You can join our Live Chat for instant support or send an e-mail to <a href="http://support@knowledgehut.com/" target="_blank">support@knowledgehut.com</a>, and we will answer any queries you may have!</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="faq-heading-1-14">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-14" aria-expanded="false" aria-controls="faq-1-14">Which is the latest version of SAFe?</a> </h4>
                                </div>
                                <div id="faq-1-14" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-14">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>The latest release of the Scaled Agile Framework (SAFe) is version 5, update 5.1. KnowledgeHut's Leading SAFe 5 Certification course is aligned with the latest version of SAFe.&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="faq-heading-1-15">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-15" aria-expanded="false" aria-controls="faq-1-15">Is SAFe 5 now version SAFe 5.1?</a> </h4>
                                </div>
                                <div id="faq-1-15" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-15">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>No. The version of SAFe remains SAFe 5. The change from SAFe 5 to 5.1 is simply a set of updates to SAFe 5. One of these updates includes a new SAFe 5.1 Big Picture, but this and the other updates, are all in support of SAFe 5 for Lean Enterprises.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="faq-heading-1-16">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-16" aria-expanded="false" aria-controls="faq-1-16">What is the difference between an upgrade and an update pertaining to the latest SAFe version?</a> </h4>
                                </div>
                                <div id="faq-1-16" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-16">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>An upgrade is when a significantly changed version of the Scaled Agile Framework® (SAFe®) is released; this is recognized typically by an increase in the major version number (e.g. 4 to 5).&nbsp;<br></p>
                                            <p><br></p>
                                            <p>Updates are when incremental changes are made to the existing version of the Framework and no upgrade is required.&nbsp; Updates do not require a retest if you already have the most up-to-date certification available, and no upgrade is required.&nbsp;</p>
                                            <p><br></p>
                                            <p>The change from SAFe 5 to 5.1 is an update, not an upgrade.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="faq-heading-1-17">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-17" aria-expanded="false" aria-controls="faq-1-17">Why is Scaled Agile, Inc. releasing these updates to SAFe 5?</a> </h4>
                                </div>
                                <div id="faq-1-17" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-17">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>With a commitment to supporting and evolving SAFe practices, Scaled Agile is on a mission to meet the ever-changing needs of SAFe Enterprises and Partner communities. Towards this end, Scaled Agile will continually update their existing articles and keep adding new ones to reflect the updated understanding from the SAFe community and practitioners on best practices in Lean Agile at scale.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="faq-heading-1-18">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-18" aria-expanded="false" aria-controls="faq-1-18">What new framework guidance is included in the latest SAFe 5.1 update?</a> </h4>
                                </div>
                                <div id="faq-1-18" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-18">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>The latest update 5.1 was rolled out to the latest version, SAFe 5 on February 10, 2021. The key updates are as follows:</p>
                                            <ul>
                                                <li>An updated <a href="#" target="_blank" rel="nofollow">Big Picture</a> (now at version 5.1)</li>
                                                <li>New guidance for operational and development value streams to support organizing around value, the #1 request from our customers</li>
                                                <li>ART and Team Topologies, patterns for organizing teams and ARTs to improve flow.</li>
                                                <li>New guidance around DevSecOps technical skills and tools that power the Continuous Delivery Pipeline.</li>
                                                <li>Integrated Participatory Budgeting, a dynamic and collaborative process of allocating funding to value streams.</li>
                                                <li>Specific guidance for applying Lean-Agile practices to business and technology domains, including a new SAFe for Hardware article.</li>
                                            </ul>
                                            <p>More information can be found on <a href="#" target="_blank" rel="nofollow">Scaled Agile</a>.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="faq-heading-1-19">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-19" aria-expanded="false" aria-controls="faq-1-19">Why should I renew my Leading SAFe® 5.1 Training?</a> </h4>
                                </div>
                                <div id="faq-1-19" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-19">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>The Scaled Agile framework is evolving, all thanks to the engagements and contributions of those who share their ideas as well as practical experiences in the workplace. Renewal of your certification validates your interest in keeping up with the latest best practices in SAFe® and your commitment to professional excellence.</p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="faq-heading-1-20">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-20" aria-expanded="false" aria-controls="faq-1-20">What is the process to renew my certification?</a> </h4>
                                </div>
                                <div id="faq-1-20" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-20">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Certifications from Scaled Agile, Inc. have a validity of one year. To renew your SAFe certification you will need to purchase the bundled product which includes Membership and Certification. This comes at a price of $295 ($100 for renewal and $195 for membership).</p>
                                            <p>If you possess more than one certification from Scaled Agile, you can renew all of them together at this cost. For example, if you have a Leading SAFe certification expiring on 6 Mar 2022 and an SASM certification expiring on 10 October 2022, when you pay $295, both certifications will get renewed and will have the same expiry of 10 October 2023 or whichever is the later date.</p>
                                            <p>Here are the steps to renew your certification:</p>
                                            <p>- Log in to the SAFe Community <a href="https://community.scaledagile.com/s/login/?language=en_US" target="_blank" rel="nofollow">platform</a> using your credentials.<br></p>
                                            <p>- Click on the "Renew" button next to your certification (located at the top of the homepage)<br></p>
                                            <p>- You will then be presented with the payment Screen (Shopping Cart), allowing you to complete the renewal process.<br></p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div class="panel panel-default">
                                <div class="panel-heading" role="tab" id="faq-heading-1-21">
                                    <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-21" aria-expanded="false" aria-controls="faq-1-21">What if I do not want to renew my certification, but remain a member of the SAFe Community Platform?</a> </h4>
                                </div>
                                <div id="faq-1-21" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-1-21">
                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>In that case, you will only need to pay $195 and continue to benefit from all the valuable content and interactions at the SAFe Community Platform.<br></p>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </section>
        <section class="cert-and-exam" id="seo-unique-content-1">
            <div class="container">
                <div class="row">
                    <div class="col-md-9">
                        <h2 class="section-heading">More FAQs on SAFe® Agilist Certification Training</h2>
                        <div class="cert-and-exam-section" id="certification-process-leading-safe">
                            <h3>Leading SAFe®</h3>
                            <div class="panel-group accordion seo-content-accordion-1" role="tablist" aria-multiselectable="true">
                                <div class="panel panel-default">
                                    <div class="panel-heading active" role="tab" id="seo-content-heading-1-1">
                                        <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-1" aria-expanded="true" aria-controls="seo-content-1-1">What is the Scaled Agile Framework?</a> </h4>
                                    </div>
                                    <div id="seo-content-1-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-1-1">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>The Scaled Agile Framework (SAFe®) is a complete methodology for large-scale Agile project teams to carry out an Agile transformation seamlessly. It provides a guide to work at the Portfolio, Large Solution, Program, and Team levels. After implementing SAFe®, businesses are yielding benefits that include:</p>
                                                <ul>
                                                    <li>10 – 50% happier, more motivated employees</li>
                                                    <li>30 – 75% faster time-to-market</li>
                                                    <li>20 – 50% increase in productivity</li>
                                                    <li>25 – 75% defect reduction</li>
                                                </ul>
                                                <p><strong>History of Scaled Agile Framework (SAFe®)<br></strong><br>Since its inception in 2011, Scaled Agile, Inc. has come up with 5 major updates to its SAFe® framework that reflect the changing industry needs. The latest upgrade is version 5.1, which introduces the ‘Seven Core Competencies’ of the Lean Enterprise. These competencies help SAFe® organizations in building a truly Lean enterprise, which is critical to achieving an advantage over your peers in an increasingly competitive age.<strong><br></strong></p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-1-2">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-2" aria-expanded="false" aria-controls="seo-content-1-2">What are the roles and responsibilities in SAFe®?</a> </h4>
                                    </div>
                                    <div id="seo-content-1-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-2">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>SAFe® consists of different roles at 4 levels of the organization. The responsibilities of the Scaled Agile (SAFe®) roles are as follows.</p>
                                                <p><strong><br>Team Level:</strong></p>
                                                <p>The roles at this level synchronize and coordinate with the team level events. This helps Agile teams develop and deliver a value in the context of the Agile Release Train (ART). The team level roles include-</p>
                                                <ul>
                                                    <li><strong>Agile Team-</strong> A cross-functional team which includes Product Owner, Scrum Master, and Dev Team.</li>
                                                    <li><strong>Development Team-</strong> A cross-functional team which includes testers, developers, and other specialists, delivers a vertical slice of functionality.</li>
                                                    <li><strong>Product Owner- </strong>Responsible for prioritizing the blog and defining user stories.</li>
                                                    <li><strong>Scrum Master- </strong>An Agile Team coach and servant leader who helps the team to facilitate team events, removes impediments and fosters an environment for high-performing teams.</li>
                                                </ul>
                                                <p><strong><br>Program Level:</strong></p>
                                                <p>The roles at the Program level keep the team aligned to a project goal and support the ARTs with the necessary governance. The roles include-<strong><br></strong></p>
                                                <ul>
                                                    <li><strong>System Engineer- </strong>An individual that applies system thinking in the project</li>
                                                    <li><strong>Product Management- </strong>They are responsible for the program backlog and work with the customers and product owners to understand the requirements.</li>
                                                    <li><strong>Release Train Engineer-</strong> A chief Scrum Master and a servant leader who facilitates optimizing the flow of value using different mechanisms.</li>
                                                    <li><strong>Business Owner-</strong>&nbsp;A small group of stakeholders who have the technical responsibility for ROI.&nbsp;</li>
                                                </ul>
                                                <p><strong><br>Large Solution Level:</strong></p>
                                                <p>The roles at the Large solution level coordinate multiple supplier and ARTs and provide the required governance. The roles include-<strong><br></strong></p>
                                                <ul>
                                                    <li><strong>Customer-</strong> The buyer of every solution.</li>
                                                    <li><strong>Solution Architect/Engineering-</strong> A small team or an individual that defines a common architectural and technical vision for the solution under development.</li>
                                                    <li><strong>Solution Management- </strong>Work with customers in order to understand their needs.</li>
                                                    <li><strong>Solution Train Engineer- </strong>A coach and servant leader who guides and facilitates the suppliers and ARTs.</li>
                                                    <li><strong>Supplier-</strong> An internal or external organization that builds and delivers the components, services, or subsystems.</li>
                                                </ul>
                                                <p><strong><br></strong></p>
                                                <p><strong>Portfolio Level:<br></strong></p>
                                                <p>The roles at the Portfolio level coordinate at the multiple stream level and provide the highest level of governance and accountability.</p>
                                                <ul>
                                                    <li><strong>Lean-Portfolio Management-</strong> Represents the individuals with the highest level of decision making and financial accountability.</li>
                                                    <li><strong>Epic Owners-</strong> Coordinate portfolio epics via the portfolio Kanban systems</li>
                                                    <li><strong>Enterprise Architect-</strong> Optimizes portfolio outcomes by providing the strategic technical direction.</li>
                                                </ul>
                                                <p><strong><br></strong></p>
                                                <p><strong>Other supporting Roles:<br></strong></p>
                                                <p> </p>
                                                <ul>
                                                    <li><strong>System team- </strong>Helps in creating and using the Agile development environment.</li>
                                                    <li><strong>Lean User Experience (Lean UX)-</strong> A process, culture, and mindset that embraces Lean-Agile methods.</li>
                                                    <li><strong>Lean-Agile Leaders- </strong>Responsible for the successful adoption of SAFe®.</li>
                                                </ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-1-3">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-3" aria-expanded="false" aria-controls="seo-content-1-3">What are the different SAFe Certifications available in Scaled Agile?</a> </h4>
                                    </div>
                                    <div id="seo-content-1-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-3">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Scaled Agile is the certifying body for the Scaled Agile Framework or SAFe. It is a professional certification program that assesses the knowledge, skills, and mindset of professionals. Here are the various SAFe Certifications available from Scaled Agile:</p>
                                                <ul>
                                                    <li><b>Certified SAFe Agile Product Manager</b></li>
                                                </ul>
                                                <p>This certification combines the values and principles of Lean-Agile with design thinking for creating viable, sustainable, feasible, and desirable solutions and products. For this certification, you must have the following prerequisites:</p>
                                                <p></p>
                                                <p></p>
                                                <ul></ul>
                                                <p></p>
                                                <ul>
                                                    <li style="margin-left:25px;">Familiarity with the principles and practices of Agile</li>
                                                    <li style="margin-left:25px;">Completed at least one SAFe course</li>
                                                    <li style="margin-left:25px;">Background in solution or product management</li>
                                                    <li style="margin-left:25px;">Experience being a business owner, product marketer, product manager, or product owner</li>
                                                    <li><b>Certified SAFe Lean Portfolio Manager</b></li>
                                                </ul>
                                                <p>These professionals understand how to establish a strategy and investment fund, apply Lean governance and Agile portfolio operation, and build a plan for the implementation of Lean Portfolio Management. Here are the prerequisites for this certification:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">An understanding of SAFe, strategy and funding models</li>
                                                    <li style="margin-left:25px;">Knowledge of value stream organization</li>
                                                    <li style="margin-left:25px;">Should have attended the Lean Portfolio Management course</li>
                                                    <li><b>Certified SAFe Architect</b></li>
                                                </ul>
                                                <p>These professionals are a change agent and an effective leader who delivers the Agile Architecture for enabling the creation of business value. The prerequisites for this program are:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Knowledge of the application of Lean-Agile principles</li>
                                                    <li style="margin-left:25px;">Should have attended the SAFe for Architects course</li>
                                                    <li><b>Certified SAFe Agile Software Engineer</b></li>
                                                </ul>
                                                <p>These professionals are responsible for applying test-first principles so that they can create alignment between requirements and test, communicate with Agile modelling, apply Lean-Agile principles, build applications with design and code quality, etc. You must satisfy the following requirements for this program:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Understand the SAFe framework</li>
                                                    <li style="margin-left:25px;">Have a background in development, engineering, quality assurance or managing development.</li>
                                                    <li style="margin-left:25px;">Should have attended the SAFe 5 Agile Software Engineering course</li>
                                                    <li><b>Certified SAFe Government Practitioner</b></li>
                                                </ul>
                                                <p>This program is for the SAFe change agent who uses the principles and practices of SAFe to execute and release value through Agile Release Trainings (ARTs) while leading a Lean-Agile transformation. The prerequisites for this certification are:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Foundational understanding of SAFe principles, House of Lean, and Agile Manifesto.</li>
                                                    <li style="margin-left:25px;">Understanding of the lifecycle of government technology programs.</li>
                                                    <li style="margin-left:25px;">Should have attended the SAFe Government course.</li>
                                                    <li><b>Certified SAFe DevOps Practitioner</b></li>
                                                </ul>
                                                <p>This is a SAFe professional who improves the flow of value throughout the Continuous Delivery Pipeline - from idea to the operational solution. Here are the prerequisites for this certification program:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Experience working in operations or development environment</li>
                                                    <li style="margin-left:25px;">Should have attended the SAFe 5 DevOps Practitioner course</li>
                                                    <li><b>Certified SAFe Program Consultant</b></li>
                                                </ul>
                                                <p>These professionals are SAFe change agents leading all organizational levels through the Lean-Agile transformation by coaching, training, mentoring, and facilitation. The certification has the following requirements:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Should possess facilitation, time and classroom management skills</li>
                                                    <li style="margin-left:25px;">Sufficient Agile experience to be able to teach it to beginners</li>
                                                    <li style="margin-left:25px;">Technical skills to work with the workflows and processes</li>
                                                    <li style="margin-left:25px;">Should have attended the Implementing SAFe course</li>
                                                    <li><b>Certified SAFe Release Train Engineer&nbsp;</b><br></li>
                                                </ul>
                                                <p>These are coaching professionals and program servant leaders who drive end-to-end delivery of value in a value stream or a single program of a Lean-Agile enterprise. Prerequisites for this program are as follows:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Skills for cross-team communication</li>
                                                    <li style="margin-left:25px;">Working knowledge of team dynamics</li>
                                                    <li style="margin-left:25px;">Knows how to use SAFe principles in action and can coach</li>
                                                    <li style="margin-left:25px;">Launch or participate in at least one Program Increment (PI) or ART</li>
                                                    <li style="margin-left:25px;">Minimum 3 months of hands-on, real-world experience as an RTE</li>
                                                    <li style="margin-left:25px;">Attend the SAFe Release Train Engineer Course</li>
                                                    <li><b>Certified SAFe Product Owner/Product Manager</b><br></li>
                                                </ul>
                                                <p>This SAFe professional works with development organizations and customers to identify and prioritize requirements. The prerequisites for this certification program are:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Experience in Agile and Lean</li>
                                                    <li style="margin-left:25px;">Should have attended the SAFe Product Owner/Product Manager course</li>
                                                    <li><b>Certified SAFe Advanced Scrum Master</b></li>
                                                </ul>
                                                <p>These professionals are Scrum Masters who are responsible for improving the results of the team by facilitating relentless improvement and cross-team interactions. Here are the prerequisites for this certification program:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Hands-on experience in a Lean-Agile environment</li>
                                                    <li style="margin-left:25px;">Should have attended the SAFe Advanced Scrum Master course</li>
                                                    <li><b>Certified SAFe Scrum Master&nbsp;</b></li>
                                                </ul>
                                                <p>These are SAFe Scrum Master Professionals who integrate the Scrum practices into an organization. Here are the requirements for this certification program:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Hands-on, real-world experience working in an Agile-Lean environment</li>
                                                    <li style="margin-left:25px;">Should have attended the SAFe Scrum Master course</li>
                                                    <li><b>Certified SAFe Practitioner</b></li>
                                                </ul>
                                                <p>They are SAFe team members responsible to use Scrum, Extreme Programming (XP), and Kanban in a SAFe environment. Here are the prerequisites:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Familiarity with Scrum, XP, Kanban, concepts, and principles of Agile</li>
                                                    <li style="margin-left:25px;">Working knowledge of hardware and software development process</li>
                                                    <li style="margin-left:25px;">Should have attended the SAFe for Teams course</li>
                                                    <li><b>Certified SAFe Agilist</b></li>
                                                </ul>
                                                <p>These are SAFe enterprise leadership professionals who are a part of the Lean-Agile transformation. Prerequisites for this certification are:</p>
                                                <ul>
                                                    <li style="margin-left:25px;">Experience in Scrum</li>
                                                    <li style="margin-left:25px;">At least 5 years of experience in software development, testing, product or project management, and business analysis</li>
                                                    <li style="margin-left:25px;">Should have attended the Leading SAFe course</li>
                                                </ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-1-4">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-4" aria-expanded="false" aria-controls="seo-content-1-4">What is SAFe Digital Badge?</a> </h4>
                                    </div>
                                    <div id="seo-content-1-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-4">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Certified SAFe professionals are recognized globally for their knowledge of SAFe. Digital badges. Through these digital badges, they can share their online verifiable certifications online on digital signatures, social media sites, and email signatures. The badges include metadata describing the qualifications of a Certified SAFe professional.</p>
                                                <p><br>Scaled Agile is partnered with Acclaim for providing digital versions of SAFe certifications. Once the individual has earned their SAFe certification and set their Community Platform privacy reference for sharing their data with Acclaim, they will receive an email from Acclaim to claim their digital badge. All you have to do for activating the digital badge is click the link present in the email, make an account on the Acclaim, claim the badge, and share it through email or social media.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-1-5">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-5" aria-expanded="false" aria-controls="seo-content-1-5">Who is the Target Audience for Leading SAFe certification?</a> </h4>
                                    </div>
                                    <div id="seo-content-1-5" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-5">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>There are no eligibility requirements for the Leading SAFe course. However, basic experience is recommended in software development and testing, product or project management, business analysis, and Scrum before you start the course. The course is created for professionals who want to better execute their roles in the SAFe organization. Here is the target audience for the Leading SAFe course:</p>
                                                <ul>
                                                    <li>Leaders and Executives (Directors, Managers, VPs, CIOs, etc.)</li>
                                                    <li>Experienced testers who want to get a better understanding of their roles</li>
                                                    <li>Project and Program Managers</li>
                                                    <li>QA, Development, and Infrastructure Management</li>
                                                    <li>Product Line Management</li>
                                                    <li>Process leads and PMOs</li>
                                                    <li>System, Solutions, and Enterprise Architects</li>
                                                </ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-1-6">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-6" aria-expanded="false" aria-controls="seo-content-1-6">What's new and different in SAFe5?</a> </h4>
                                    </div>
                                    <div id="seo-content-1-6" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-6">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Scaled Agile announced a new version of the Scaled Agile Framework, SAFe 5.0 at this year’s Global SAFe summit. The new version has a simple model presentation and emphasized on the business agility. It also focuses on customer-centricity and expanding the aspect of portfolio management. Here are some more changes made in the SAFe 5.0:</p>
                                                <ul>
                                                    <li>Business Agility at the forefront</li>
                                                    <li>New metric in the framework - Business Agility Assessment</li>
                                                    <li>Two new competencies - Organizational Agility and Continuous Learning culture</li>
                                                    <li>New level in SAFe (Essential SAFe) and two competencies have been redefined (Enterprise Solution Delivery and Agile Product Delivery)</li>
                                                    <li>Renewed emphasis on the Lean Portfolio Management’s Core Competency</li>
                                                    <li>New themes - Design thinking and Customer Centricity</li>
                                                    <li>New Principle - Organize around the value</li>
                                                </ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-1-7">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-1" href="#seo-content-1-7" aria-expanded="false" aria-controls="seo-content-1-7">What is the SAFe Implementation Roadmap?</a> </h4>
                                    </div>
                                    <div id="seo-content-1-7" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-1-7">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>The SAFe Implementation Roadmap provides a strategy and a set of activities that can help in implementing SAFe successfully. Achieving the benefits of Lean/Agile development and business agility at scale takes a lot of effort. Before you can get the rewards of SAFe, your organization needs to embrace the Lean/Agile mindset and implement the Lean/Agile principles. And even though there are no perfect step-by-step instructions for implementation, the following 12 steps can help in getting the best results to the businesses:</p>
                                                <ol>
                                                    <li><b>Recognize the tipping point<br></b>Organizations must recognize once they have reached their tipping point, a point at which the only reasonable way forward is toward success. The reason for change will get so compelling that resisting it will be unacceptable</li>
                                                    <li><b>Train Lean-Agile Change Agents</b><br>All the Lean-Agile change agents will be trained as the Certified SAFe Program Consultants who can offer the knowledge and horsepower to the business for implementing the change.&nbsp;</li>
                                                    <li><b>Train executives, managers, and leaders</b><br>Implementing any change requires strong leadership. In the case of SAFe, some leaders will provide ongoing and direct sponsorship for the change as participants in the LACE (Lean-Agile Center of Excellence). Some others will be involved with implementing SAFe or leading, influencing, and managing the transformation.&nbsp;</li>
                                                    <li><b>Create a Lean-Agile Center of Excellence<br></b>LACE is a team of people who are dedicated to the implementation of SAFe in the organization. This is among the key differences between companies that are committed to the practices of Lean-Agile and those who are practicing Agile just for the purpose of the name. </li>
                                                    <li><b>Identify Value Streams and ARTs<br></b>This requires an in-depth understanding of the organizational model that will be facilitating the flow of value through functional silos, boundaries, and activities.</li>
                                                    <li><b>Create the Implementation Plan</b><br>The newly trained Lean-Agile leaders will apply their new knowledge for identifying the strategies to implement the framework. This leads to the creation of the implementation plan.&nbsp;</li>
                                                    <li><b>Prepare for ART Launch <br></b>This includes executing the activities required for the successful ART launch. SAFe Program Consultants will lead this implementation.&nbsp;</li>
                                                    <li><b>Train teams and launch the ART <br></b>This includes focusing on the Agile teams who will be creating the system needed by the organization.&nbsp;&nbsp;</li>
                                                    <li><b>Coach ART Execution<br></b>By now, organizations will have made an investment in training stakeholders and developing SPC change agents in the new working ways. Now the time is for the Lean-Agile leaders to focus on what actually matters. This will start with ART-level and team-level coaching.</li>
                                                    <li><b>Launch more ARTs and Value Streams<br></b>This stage involves moving at an accelerated speed. The enterprise will launch more ARTs and value streams for consolidating gains and producing more change. The organization will be able to realize the complete benefits of SAFe.&nbsp;</li>
                                                    <li><b>Extend to the Portfolio</b><br>With the success of the ARTs and value streams, the organization will be exposed to traditional and phase-gated processes that impede performance. This will put pressure on the portfolio triggering the need for more changes that can improve strategic flow.</li>
                                                    <li><b>Accelerate</b><br>This is the start of another journey that is based on relentless improvement. The emerging Lean enterprise will now have to start to create a new operating culture and model, one where the practices and principles of Lean and Agile are the norms.&nbsp;</li>
                                                </ol>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="cert-and-exam-section" id="certification-process-leading-safe-training">
                            <h3>Leading SAFe® Training</h3>
                            <div class="panel-group accordion seo-content-accordion-2" role="tablist" aria-multiselectable="true">
                                <div class="panel panel-default">
                                    <div class="panel-heading active" role="tab" id="seo-content-heading-2-1">
                                        <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-2" href="#seo-content-2-1" aria-expanded="false" aria-controls="seo-content-2-1">Who should take the Leading SAFe® 5.0 training?</a> </h4>
                                    </div>
                                    <div id="seo-content-2-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-2-1">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>The following individuals will benefit from SAFe® Agilist course:</p>
                                                <ul>
                                                    <li>Executives and Leaders, Managers, Directors, CIOs, and VPs</li>
                                                    <li>Development, QA, and Infrastructure Management personnel</li>
                                                    <li>Program and Project Managers</li>
                                                    <li>Product and Product Line Managers</li>
                                                    <li>Portfolio Managers, PMO, and Process Leads</li>
                                                    <li>Enterprise, System, and Solution Architects</li>
                                                </ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-2-2">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-2" href="#seo-content-2-2" aria-expanded="false" aria-controls="seo-content-2-2">Are there any eligibility criteria for attending Leading SAFe® 5.0 course?</a> </h4>
                                    </div>
                                    <div id="seo-content-2-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-2-2">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>While there is no eligibility criterion for attending the workshop, participants who wish to take the SAFe® Agilist exam must have at least:</p>
                                                <p> </p>
                                                <ul>
                                                    <li>5+ years of experience in software development, testing, business analysis, product or project management</li>
                                                    <li>Experience in Scrum</li>
                                                </ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-2-3">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-2" href="#seo-content-2-3" aria-expanded="false" aria-controls="seo-content-2-3">Who are the Leading SAFe® instructors/trainers?</a> </h4>
                                    </div>
                                    <div id="seo-content-2-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-2-3">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Our SAFe® instructors have the practical understanding of how the framework is implemented within complex organizations as they have hands-on experience working in enterprises that are actively implementing Scaled Agile Framework in their pursuit of business agility. They provide participants with an exceptional training experience by combining leading-edge industry expertise with proven educational training methods. You will hugely benefit from their professional expertise and industrial experience.&nbsp;<br></p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-2-4">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-2" href="#seo-content-2-4" aria-expanded="false" aria-controls="seo-content-2-4">Do you offer an online/ virtual Leading SAFe® 5.0 training course?</a> </h4>
                                    </div>
                                    <div id="seo-content-2-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-2-4">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>No, there is no such Scaled Agile Framework (SAFe®) online training provided. The SAFe® 5 Agilist Certification requires in-depth knowledge of the SAFe® framework which you get from our certified experts who lead the workshop.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="cert-and-exam-section" id="certification-process-safe-agilist-exam">
                            <h3>SAFe® Agilist Exam</h3>
                            <div class="panel-group accordion seo-content-accordion-3" role="tablist" aria-multiselectable="true">
                                <div class="panel panel-default">
                                    <div class="panel-heading active" role="tab" id="seo-content-heading-3-1">
                                        <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-1" aria-expanded="false" aria-controls="seo-content-3-1">What is the pattern, format, and duration of the SAFe® Agilist exam?</a> </h4>
                                    </div>
                                    <div id="seo-content-3-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-3-1">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>The Scaled Agile Framework certification exam is an online test comprising of 45 multiple choice questions. Candidates will have 90 minutes (1.5 hours) to complete the exam and must score a minimum of 35 questions right to pass the Leading SAFe® 5 exam and obtain your SAFe® Agilist certification.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-3-2">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-2" aria-expanded="false" aria-controls="seo-content-3-2">What is the difficulty level of the SAFe® Agilist exam?</a> </h4>
                                    </div>
                                    <div id="seo-content-3-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-2">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>The Leading SAFe® 5 exam is really tough and if you lack experience in SAFe® implementation or Scrum then it becomes very difficult to crack the exam. It is highly recommended to practice SAFe® Agilist certification exam sample questions to pass the exam on your first attempt. You can take mock tests for practice purposes that have the same level of difficulty.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-3-3">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-3" aria-expanded="false" aria-controls="seo-content-3-3">How do I access my SAFe® Agilist exam?</a> </h4>
                                    </div>
                                    <div id="seo-content-3-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-3">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Follow the steps below to access your course exam:</p>
                                                <ul>
                                                    <li>You are required to attend a Leading SAFe® 5.0 course after which you will receive an e-mail containing your login credentials to the SAFe® Community Platform</li>
                                                    <li>Log-in to your Community profile</li>
                                                    <li>Click the Learning tab in the top navigation menu</li>
                                                    <li>Go to the In Progress section</li>
                                                    <li>Select the Learning Plan tile for your course</li>
                                                    <li>Complete the feedback survey</li>
                                                    <li>Scroll to the bottom of the plan to locate the exam, then click the blue Launch button</li>
                                                </ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-3-4">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-4" aria-expanded="false" aria-controls="seo-content-3-4">What certification will I receive after completing the SAFe® 5 Agilist training and sitting for the exam?</a> </h4>
                                    </div>
                                    <div id="seo-content-3-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-4">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Candidates who have achieved 77% passing score (35/45) in the certification exam will receive the SAFe® Agilist Certification from Scaled Agile.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-3-5">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-5" aria-expanded="false" aria-controls="seo-content-3-5">What is the exam retake process for the SAFe® Agilist exam?</a> </h4>
                                    </div>
                                    <div id="seo-content-3-5" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-5">
                                        <div class="panel-body">
                                            <div class="editor-content"> First exam attempt is included as part of the course registration fee if the exam is taken within 30 days of course completion. Each retake attempt costs $50. Second attempt on exam (first retake) can be done immediately after first attempt. Third attempt requires a 10-day wait. Fourth attempt requires a 30-day wait. </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-3-6">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-3" href="#seo-content-3-6" aria-expanded="false" aria-controls="seo-content-3-6">I have cleared my SAFe® Agilist exam. How do I locate my certificate on the Scaled Agile website?</a> </h4>
                                    </div>
                                    <div id="seo-content-3-6" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-3-6">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Follow the steps below to obtain your certificate on successful completion of your exam:</p>
                                                <p> </p>
                                                <ul>
                                                    <li>Login and click on <strong>My Profile</strong> on the upper-right bar</li>
                                                    <li>In the box at the right hand of My Profile, go to <strong>Manage Profile</strong></li>
                                                    <li>Scroll down to <strong>Content &amp; Features</strong> and choose <strong>Professional Development</strong></li>
                                                    <li>Choose and click on the <strong>Certifications/Programs</strong> tab</li>
                                                    <li>Click on the <strong>certificate icon</strong> to the left of "Certification Name"</li>
                                                    <li>Once you have accessed your certificate, you can download and print it.</li>
                                                </ul>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="cert-and-exam-section" id="certification-process-safe-agilist-certification">
                            <h3>SAFe® Agilist Certification</h3>
                            <div class="panel-group accordion seo-content-accordion-4" role="tablist" aria-multiselectable="true">
                                <div class="panel panel-default">
                                    <div class="panel-heading active" role="tab" id="seo-content-heading-4-1">
                                        <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-1" aria-expanded="false" aria-controls="seo-content-4-1">What is SAFe® Agilist certification?</a> </h4>
                                    </div>
                                    <div id="seo-content-4-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-4-1">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>A Certified SAFe® Agilist (SA) is a professional who has completed the Leading SAFe® certification and been successful in the Scaled Agile Framework certification test. By acquiring the SAFe® Agilist certification provided by Scaled Agile, Inc, you will be able to address the critical challenges of creating and delivering enterprise-level software and systems in the shortest time. It gives guidance for all levels of organizations that are actively involved in solution development: Portfolio, Program, Team, and Large Solutions.&nbsp;<br></p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-4-2">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-2" aria-expanded="false" aria-controls="seo-content-4-2">Why should I go for the SAFe® Agilist (SA) certification?</a> </h4>
                                    </div>
                                    <div id="seo-content-4-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-2">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Holding the SAFe® Agilist certification shows your proficiency in implementing lean thinking,&nbsp; SAFe® Framework, and Product development flow principles in an organizational context. Our two-day Scaled Agile Framework (SAFe®) training course gives you practical experience of applying Scaled Agile Framework in large enterprises which is delivered by a SAFe® Program Consultant, authorized by&nbsp;<span style="color:#222;font-family:Arial,Helvetica,sans-serif;font-size:small;">Scaled Agile, Inc</span>.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-4-3">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-3" aria-expanded="false" aria-controls="seo-content-4-3">What is the importance of a SAFe® 5 Agilist (SA) certification?</a> </h4>
                                    </div>
                                    <div id="seo-content-4-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-3">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>While it is easy to apply Lean/Agile principles at the team or department level, replicating these benefits at the enterprise level is often challenging due to the scale of the change. Organizations, therefore, rely on the Scaled Agile Framework (SAFe®) that helps seamlessly carry out large-scale, multi-team transformations. SAFe® 5 Agilists are in much demand for their expertise in leading this change through carefully thought of program releases and identifying roles and structures required to scale Agile to the program level.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-4-4">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-4" aria-expanded="false" aria-controls="seo-content-4-4">Who offers the SAFe® Agilist certification?</a> </h4>
                                    </div>
                                    <div id="seo-content-4-4" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-4">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Scaled Agile, Inc. is the provider of SAFe® which is one of the best-known frameworks for enterprise agility. SAFe® was initially released in 2011 by Dean Leffingwell as a knowledge base for enterprises to adopt Agile. It is the leading provider of SAFe® courses for implementing Agile practices at enterprise level. The SAFe® Agilist (SA) Certification is given to those who have undertaken the SAFe® 5 Agilist Certification Exam and received the passing score.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-4-5">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-5" aria-expanded="false" aria-controls="seo-content-4-5">What is the average salary of a SAFe® Agilist?</a> </h4>
                                    </div>
                                    <div id="seo-content-4-5" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-5">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>The average salary of&nbsp;a Scaled Agile Certified&nbsp;SAFe®&nbsp;Agilist&nbsp;(SA)&nbsp;professional is&nbsp;<a href="https://www.payscale.com/research/US/Certification=Scaled_Agile_Certified_SAFe_Agilist_(SA)/Salary" target="_blank" rel="nofollow">$100k per year</a>.&nbsp;</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-4-6">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-6" aria-expanded="false" aria-controls="seo-content-4-6">How much does the SAFe® Agilist certification cost?</a> </h4>
                                    </div>
                                    <div id="seo-content-4-6" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-6">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>The Scaled Agile Framework certification cost is included in the SAFe® Agilist course fee.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-4-7">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-7" aria-expanded="false" aria-controls="seo-content-4-7">What is the Leading SAFe® 5 Certification Process?</a> </h4>
                                    </div>
                                    <div id="seo-content-4-7" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-7">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p><strong>Step &nbsp;1:</strong> <b>Register for a 2-day course<br></b>Attend 14-16 hours of training delivered by an authorized training partner.&nbsp; &nbsp;&nbsp;<br><br><b>Step 2: Get access to the exam</b></p>
                                                <ul>
                                                    <li>On successful completion of 2 days of training, you will be receiving the exam information directly from Scaled Agile.</li>
                                                    <li>Log in and you are ready to take the exam.</li>
                                                </ul>
                                                <p><strong>Step 3: Take the </strong><strong>exam</strong></p>
                                                <ul>
                                                    <li>1.5-hour online test</li>
                                                    <li>45 MCQs</li>
                                                    <li>Closed-book exam</li>
                                                </ul>
                                                <p><strong>Step 4:</strong> <strong>Pass the exam</strong></p>
                                                <p>Score a minimum of 77% (35 out of 45) to pass the SAFe®️ Agilist test.<br><br><b>Step 5: Get SAFe</b>®️<strong> Agilist Certification</strong></p>
                                                <p><span style="color:#222;font-family:Arial,Helvetica,sans-serif;font-size:small;">Scaled Agile, Inc</span>&nbsp;will dispatch your certificate within 5-7 business days with a 1-year membership after passing the exam.</p>
                                                <p><br></p>
                                                <p> </p>
                                                <p>Ready to take up the certification? <a href="#" target="_blank">Click here</a></p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-4-8">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-4" href="#seo-content-4-8" aria-expanded="false" aria-controls="seo-content-4-8">Do I need to renew my Leading SAFe® 5 certification?</a> </h4>
                                    </div>
                                    <div id="seo-content-4-8" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-4-8">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>SAFe® Agilist certification renewal needs to be done every 1 year. You need to pay $100 to extend the credential for a further 1 year from the date of your current expiration.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="cert-and-exam-section" id="certification-process-pdus-seus">
                            <h3>PDUs &amp; SEUs</h3>
                            <div class="panel-group accordion seo-content-accordion-5" role="tablist" aria-multiselectable="true">
                                <div class="panel panel-default">
                                    <div class="panel-heading active" role="tab" id="seo-content-heading-5-1">
                                        <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".seo-content-accordion-5" href="#seo-content-5-1" aria-expanded="false" aria-controls="seo-content-5-1">What do you mean by SEUs?</a> </h4>
                                    </div>
                                    <div id="seo-content-5-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="seo-content-heading-5-1">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>SEUs are Scrum Educational Units, issued by the <a href="https://www.scrumalliance.org/" target="_blank" rel="nofollow">Scrum Alliance</a>. They can be earned by completing educational training or learning opportunities, which serve to validate your participation and continued proficiency in the principles and practices of Scrum. To maintain your certification from Scrum Alliance, you are required to earn a certain number of SEUs every two years.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-5-2">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-5" href="#seo-content-5-2" aria-expanded="false" aria-controls="seo-content-5-2">Where are PDUs and SEUs applicable?</a> </h4>
                                    </div>
                                    <div id="seo-content-5-2" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-5-2">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>PDUs and SEUs are credits awarded by the <a href="https://www.pmi.org/certifications/certification-resources/maintain/earn-pdus" target="_blank" rel="nofollow">Project Management Institute</a> and <a href="https://www.scrumalliance.org/get-certified/scrum-education-units" target="_blank" rel="nofollow">Scrum Alliance</a> respectively. They recognize your dedication to the Project Management and the Agile world through the award of credits for every educational effort you make throughout your career. Scrum Alliance members who hold a credential from Scrum Alliance need to earn SEUs to get recertified every two years. Every PMI® certification, except the CAPM®, requires you to earn a specific number of PDUs per three-year certification cycle in order to maintain your credentials.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                                <div class="panel panel-default">
                                    <div class="panel-heading" role="tab" id="seo-content-heading-5-3">
                                        <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".seo-content-accordion-5" href="#seo-content-5-3" aria-expanded="false" aria-controls="seo-content-5-3">Will I get any PDUs and SEUs after completing your SAFe® Agilist training program?</a> </h4>
                                    </div>
                                    <div id="seo-content-5-3" class="panel-collapse collapse" role="tabpanel" aria-labelledby="seo-content-heading-5-3">
                                        <div class="panel-body">
                                            <div class="editor-content">
                                                <p>Yes, you will get 16 PDUs and 16 SEUs toward your continuing education requirements with the Project Management Institute (PMI)® for PMP® and PMI-ACP® certifications.</p>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </section>
