                        "text": "<p>Holding the SAFe® Agilist certification shows your proficiency in implementing lean thinking,&nbsp; SAFe® Framework, and Product development flow principles in an organizational context. Our two-day Scaled Agile Framework (SAFe®) training course gives you practical experience of applying Scaled Agile Framework in large enterprises which is delivered by a SAFe® Program Consultant, authorized by&nbsp;<span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Scaled Agile, Inc</span>.</p>"
                    }
                }, {
                    "@type": "Question",
                    "name": "What is the average salary of a SAFe® Agilist?",
                    "acceptedAnswer": {
                        "@type": "Answer",
                        "text": "<p>The average salary of&nbsp;a Scaled Agile Certified&nbsp;SAFe®&nbsp;Agilist&nbsp;(SA)&nbsp;professional is&nbsp;<a href=\"https://www.payscale.com/research/US/Certification=Scaled_Agile_Certified_SAFe_Agilist_(SA)/Salary\" target=\"_blank\" rel=\"nofollow\">$100k per year</a>.&nbsp;</p>"
                    }
                }, {
                    "@type": "Question",
                    "name": "How much does the SAFe® Agilist certification cost?",
                    "acceptedAnswer": {
                        "@type": "Answer",
                        "text": "<p>The Scaled Agile Framework certification cost is included in the SAFe® Agilist course fee.</p>"
                    }
                }, {
                    "@type": "Question",
                    "name": "What is the Leading SAFe® 5 Certification Process?",
                    "acceptedAnswer": {
                        "@type": "Answer",
                        "text": "<p><strong>Step &nbsp;1:</strong> <b>Register for a 2-day course<br></b>Attend 14-16 hours of training delivered by an authorized training partner.&nbsp; &nbsp;&nbsp;<br><br><b>Step 2: Get access to the exam</b></p><ul>\r\n<li>On successful completion of 2 days of training, you will be receiving the exam information directly from Scaled Agile.</li>\r\n<li>Log in and you are ready to take the exam.</li>\r\n</ul><p><strong>Step 3: Take the </strong><strong>exam</strong></p><ul>\r\n<li>1.5-hour online test</li>\r\n<li>45 MCQs</li>\r\n<li>Closed-book exam</li>\r\n</ul><p><strong>Step 4:</strong> <strong>Pass the exam</strong></p><p>Score a minimum of 77% (35 out of 45) to pass the SAFe®️ Agilist test.<br><br><b>Step 5: Get SAFe</b>®️<strong> Agilist Certification</strong></p><p><span style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Scaled Agile, Inc</span>&nbsp;will dispatch your certificate within 5-7 business days with a 1-year membership after passing the exam.</p><p><br></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p>Ready to take up the certification? <a href=\"#\" target=\"_blank\">Click here</a></p>"
                    }
                }]
            }
        </script>
